import React from 'react';
import Button from './navbarbutton';
import { FaKey, ImCross } from 'react-icons/fa'; 
import { usePage } from '../PageContext'; // Importez le contexte

const NavbarRight = ({ handleNewButtonClick }) => {
  const { currentPage } = usePage(); // Utilisez le contexte pour obtenir la page actuelle

  return (
    <div style={{ display: 'flex', flexDirection: 'row', position: 'absolute', right: '48px', top: '48px', gap: '10px' }}>
      <Button icon={<FaKey />} label="Filters" />
      {currentPage !== 'home' && (
        <Button icon={<ImCross />} label="New Button" onClick={handleNewButtonClick} /> // Nouveau bouton affiché uniquement sur les nouvelles pages
      )}
    </div>
  );
};

export default NavbarRight;
